def lps(str1):
    n = len(str1)
    dp = [[0] * (n + 1) for _ in range(n + 1)]

    # Fill dp table in a bottom-up manner
    for i in range(1, n + 1):
        for j in range(1, n + 1):
            if str1[i - 1] == str1[n - j]:
                dp[i][j] = dp[i - 1][j - 1] + 2
            else:
                dp[i][j] = max(dp[i - 1][j], dp[i][j - 1])

